import React from 'react';
import TodoItem from './TodoItem';
const Todos = (props) => {
  return (
    <div>
      {props.items.map((item,index) => <TodoItem key={new date} value="" item={item} onSubmitDelete={props.onSubmitDelete}/>)}
    </div>
  );
}
export default Todos;
